// statuses:
// variantele au ori _var_ ori _test_ in ele (le-am numit idiuri)
// si cand ajungi in barem inlocuiesti aia cu _bar_
// dar cand ajungi in barem el nu stie ce id era
// si daca stochezi fiecare id e nasol
// de accea stochezi doar pe alea care nu sunt _var_ si el devine def
//
// daca intrii direct in barem si dai catre test dar testu ala are idiul de _test_
// atunci te va redirectiona la un test cu _var_ care nu exista
// bugul asta n-o sal rezolv, ca mi-e greu si nu cred ca se merita

//https://bac.simplu.info/vezi-pdf/web/viewer
const Toolbar = document.getElementById("toolbarViewerRight");

var isDone = false;
var statusIcon;

const setStatus = (a) =>
  localStorage.setItem(window.location.href + "-checked", `${a}`);
const getStatus = () => {
  // if key has no value getItem returns null
  let result = JSON.parse(
    localStorage.getItem(window.location.href + "-checked")
  );
  return result == null ? false : result;
};
const updateStatusIcon = () =>
  (statusIcon.src = isDone ? done_base64 : notdone_base64);
const toggleStatus = () => {
  isDone = !isDone;
  updateStatusIcon();
  setStatus(isDone);
};
const CreateAndAppendImgTo = (src, dest, onclick = () => {}) => {
  const img = document.createElement("img");
  img.src = src;
  img.addEventListener("click", onclick);
  dest.appendChild(img);
  return img;
};
const CreateAndAppendToolbarImg = (src, onclick = () => {}) => {
  var img = CreateAndAppendImgTo(src, Toolbar, onclick);
  img.classList.add("toolbarButton");
  return img;
};
var IsBarem = () => {
  var toSubiect = CreateAndAppendToolbarImg(
    to_subiect_base64,
    toSubiectOnclick
  );
  CtrlClick_OnLongPress(toSubiect, toSubiectOnclick, 700);

  function toSubiectOnclick(e) {
    var id = localStorage.getItem(window.location.href + "-testid") || "_var_";
    const testlink = window.location.href.replace("_bar_", id);
    if (e.ctrlKey) return window.open(testlink);
    window.location.replace(testlink);
  }
};
var IsSubiect = (id) => {
  if (statusIcon) return;

  // status
  statusIcon = CreateAndAppendToolbarImg(notdone_base64, toggleStatus);
  updateStatusIcon();

  // to barem
  const baremlink = window.location.href.replace(id, "_bar_");
  var toBaremOnclick = (e) => {
    if (id != "_var_") localStorage.setItem(baremlink + "-testid", id);
    // this else removes "_test_" from ls cuz inbarem we take what's in the ls
    // and if _test_ was present it would take that instead of _var_
    // we do not store _var_ cuz we save like half the space
    else localStorage.removeItem(baremlink + "-testid");
    if (e.ctrlKey) return window.open(baremlink);
    window.location.replace(baremlink);
  };
  var toBaremIcon = CreateAndAppendToolbarImg(to_barem_base64, toBaremOnclick);
  CtrlClick_OnLongPress(toBaremIcon, toBaremOnclick, 700);
};
function CtrlClick_OnLongPress(elem, onclick, delay = 700) {
  var expireid;
  elem.style.cssText += `-webkit-touch-callout: none !important; -webkit-user-select: none !important;`;
  window.addEventListener("pointerup", () => {
    clearTimeout(expireid);
  });
  elem.addEventListener("pointerup", () => {
    clearTimeout(expireid);
  });
  elem.addEventListener("pointerdown", (e) => {
    e.preventDefault(), e.stopImmediatePropagation();
    expireid = setTimeout(() => onclick({ ctrlKey: true }), delay);
  });
}

var loadedonce = false;
window.addEventListener("load", () => {
  if (loadedonce) return;
  loadedonce = true;

  isDone = getStatus();
  if (window.location.href.includes("_bar_")) return IsBarem();
  const ids = ["_var_", "_test_"];
  for (let i = 0; i < ids.length; i++)
    if (window.location.href.includes(ids[i])) return IsSubiect(ids[i]);
});

var handPointerStyles = `
  position: absolute;
  left: 10px;
  width: 50px;
  aspect-ratio: 1/1;
  z-index: 99999999;
  -webkit-user-select: none;
  -khtml-user-select: none;
  -moz-user-select: none;
  -o-user-select: none;
  user-select: none;
  touch-action: none;
`;

var done_base64 = ` data:image/jpeg;base64,`;
var notdone_base64 = ` data:image/jpeg;base64,`;
var to_barem_base64 = ` data:image/png;base64,`;
var to_subiect_base64 = ` data:image/png;base64,`;
var pointing_hand_right_base64 = ` data:image/jpeg;base64,`;
